'# content\?': |2
  {%
    set classes = [
      'view-' ~ id|clean_class,
      'view-display-id-' ~ display_id,
      dom_id ? 'js-view-dom-id-' ~ dom_id,
    ]
  %}
'views_view_attributes': |2
  \{\{ attributes.addClass(classes) \}\}
'title_prefix': |2
  \{\{ title_prefix \}\}
'# title': |2
  {% if title %}
'title': |2
  \{\{ title \}\}
'/ title': |2
  {% endif %}
'title_suffix': |2
  \{\{ title_suffix \}\}
'# header': |2
  {% if header %}
'header': |2
  \{\{ header \}\}
'/ header': |2
  {% endif %}
'exposed': |2
  \{\{ exposed \}\}
'attachment_before': |2
  \{\{ attachment_before \}\}
'fpo_template_content': |2
  \{\{ rows \}\}
'empty': |2
  \{\{ empty \}\}
'> 01-compounds/03-navigation/01-pagination': |2
  \{\{ pager \}\}
'attachment_after': |2
  \{\{ attachment_after \}\}
'> 02-components/03-sections/02-more-link': |2
  \{\{ more \}\}
'# footer': |2
  {% if footer %}
'footer': |2
  \{\{ footer \}\}
'/ footer': |2
  {% endif %}
'feed_icons': |2
  \{\{ feed_icons \}\}
